import Draggable from 'react-draggable';
import ControlBar from '../ControlBar.jsx';

function ProjectsFile({display, setDisplay}) {
    console.log(display);
    const offSetX = window.innerWidth / 2 + 60;
    const offSetY = 20;
    return (
        display ?
        <Draggable
            handle=".handle"
            defaultPosition={{x: offSetX, y: offSetY}}
        >
            <div className="absolute rounded-sm max-h-fit w-4/12">
                <ControlBar setDisplay={setDisplay}/>
                <div className="flex flex-col gap-4 bg-white rounded-bl-md rounded-br-md p-5">
                    <h2 class="font-bold text-3xl">Projects</h2>
                </div>
            </div>
        </Draggable>
        : null
    )
}

export default ProjectsFile;
